import React, { useEffect, useState } from 'react';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import TextField  from '@mui/material/TextField';
import Button from '@mui/material/Button/Button';
import Container from '@mui/material/Container/Container';
import Card from '@mui/material/Card/Card';
import CardContent from '@mui/material/CardContent/CardContent';
import Typography from '@mui/material/Typography/Typography';
import { List, ListItem } from '@mui/material';

interface ApiInfo {
  name: string;
  version: string;
  definition_url: string;
}

function handleApiNameClick(definition_url : String) {
  fetch(
    '/apis/' + size,
    {
    method :"GET",
    mode: "no-cors",
    headers : {
      'Content-Type':'application/json',
      'Accept': 'application/json',
      "Access-Control-Allow-Origin": "*",
    },
    }
  )
  .then(response => response.json())
  .then(data => setValues(data["apis_info"]))
  .catch(error => console.log(error))
}

export default function Home() {
  const [size, setSize] = useState<String>("25")
  const [isLoaded, setIsLoaded] = useState<Boolean>(false)
  const [values, setValues] = useState<ApiInfo[]>([{name : "API name", version: "API version", definition_url: "DEFINITION URL"}]) 

  useEffect(()=>{
    fetch(
      '/apis/' + size,
      {
      method :"GET",
      mode: "no-cors",
      headers : {
        'Content-Type':'application/json',
        'Accept': 'application/json',
        "Access-Control-Allow-Origin": "*",
      },
      }
    )
    .then(response => response.json())
    .then(data => setValues(data["apis_info"]))
    .catch(error => console.log(error))
    console.log(values)
  },[isLoaded])

  return (
    <Container maxWidth="sm">
      <Box>
        <Grid container spacing={2}>
          <Grid item xs={8}>
            <TextField 
              id="outlined-basic" 
              label="Data size"
              variant="outlined"
              value={size} 
              onChange={(e)=>{setSize(e.target.value)}}/>
          </Grid>
          <Grid item xs={4}>
            <Button 
              variant="contained"
              onClick={()=> setIsLoaded(!isLoaded)}
            >
              Load
            </Button>
          </Grid>
          <Grid item xs={6}>
              <Typography>API Names</Typography>
              <List>
                {values.map((row) => (
                      <ListItem
                        key={row.name + row.version}
                        button
                        onClick={() => handleApiNameClick(row.definition_url)}
                        >
                          {row.name}
                        </ListItem>))
                }
              </List>
          </Grid>
          <Grid item xs={6}>
            <Card sx={{ minWidth: 275 }}>
              <CardContent>
                <Typography sx={{ fontSize: 14 }} variant="h1" color="text.secondary" gutterBottom>
                  API definition
                </Typography>
                <Typography variant="body2">
                  {values[0].definition_url}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
}
